        {id:4345, name:'Hyper-X Cloud Alpha', imgUrl:'https://m.media-amazon.com/images/I/71pFeJFdJQL.jpg', category:'Headphones', price: 6450, sale: false, stock:17}
      ]
    }
    deletePr(){
      console.log('deleted');
    }
  render() {
   let allProducts = this.state.product.filter((pr)=> {
   return <Child1 inncomingProduct={pr} /> 
